import React from "react";
import styled from "styled-components";
import { Grid, Image, Text, Input } from "../../elements";

const Post = (props) => {
  console.log(props);

  return (
    <React.Fragment>
      <PostContainer>
        <Grid is_flex>
          <ContentImg src={props.image_url} />
          <Grid>
              <Grid flex>
            <Image shape="circle" src={props.profile} />
            <Text>{props.user_info.nickname}</Text>
          </Grid>
          <Grid>
            <Text>{props.contents}</Text>
            <Text>{props.comments}</Text>
            <Text>{props.like_cnt}</Text>
            <Text>{props.comment_cnt}</Text>
            <input placeholder="댓글달기" />
          </Grid>

          </Grid>

        </Grid>
      </PostContainer>
    </React.Fragment>
  );
};

Post.defaultProps = {
  id: 0,
  user_info: {
    nickname: "_nickname",
    profile:
      "https://www.zdnet.com/a/hub/i/r/2018/10/18/580b4d43-4060-4d90-be23-1f97ef795e4e/resize/1200x900/757c6793f448336b1a2c73a5d46fb971/github-logo.png",
  },
  image_url:
    "https://www.zdnet.com/a/hub/i/r/2018/10/18/580b4d43-4060-4d90-be23-1f97ef795e4e/resize/1200x900/757c6793f448336b1a2c73a5d46fb971/github-logo.png",
  contents: "개발자들의 커뮤니티, 깃로그",
  comment_cnt: 8,
  like_cnt: 20,
  insert_dt: "2021-04-12 10:00:00",
};

const PostContainer = styled.div`
  width: 100%;
`;

const ContentImg = styled.img`
  width: 50%;
  height: var(width);
`;

export default Post;
